import React from 'react';

const Home = () => {
  return (
    <div id='home'>
      <h1>Hello, I'm Jacqueline. I'm a Full Stack Software Developer.</h1>
      <i>When I'm not coding, you'll find me climbing at the local bouldering gym or experimenting with new recipes like miso basil pasta!</i>
    </div>
  )
}

export default Home
